import styled from 'styled-components'

const Container = styled.div`
    display: flex;
`

const Pane = styled.div`
    flex: ${props => props.weight};
`

export const SplitScreen = ({
    left: Left,
    right: Right,
    leftWeight = 1,
    rightWeight = 3

}) => {
    return (
        <>
            <Container>
                <Pane weight={leftWeight}>
                    <Left />
                </Pane>
                <Pane weight={leftWeight}>
                    <Right />
                </Pane>
            </Container>
        </>
    );
}
